import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import ExerciseLog from './components/ExerciseLog';
import Goals from './components/Goals';
import Progress from './components/Progress';
import Header from './components/Header';
import Home from './components/Home';
import ProtectedRoute from './components/ProtectedRoute'; // Import your ProtectedRoute
import './styles/styles.css';

function App() {
  return (
    <Router>
      <div>
        <Header />
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />

          {/* Wrap protected components in ProtectedRoute, but still use Route for structure */}
          <Route 
            path="/log-exercise" 
            element={<ProtectedRoute element={<ExerciseLog />} />} 
          />
          <Route 
            path="/goals" 
            element={<ProtectedRoute element={<Goals />} />} 
          />
          <Route 
            path="/progress" 
            element={<ProtectedRoute element={<Progress />} />} 
          />

          <Route path="/" element={<Home />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
